import PlayerHeading from "../../components/PlayerHeading";

import tyronethompson from "./assets/images/tyronethompson.png";
import ollienorris from "./assets/images/ollienorris.png";

const players = [
  {
    playerName: {
      firstName: "Tyrone",
      lastName: "Thompson",
      number: "12",
    },
    photo: tyronethompson,
    stats: [
      { attr: "OFF", value: 120 },
      { attr: "AST", value: 98 },
      { attr: "TCK", value: 86 },
      { attr: "TRY", value: 99 },
      { attr: "PAS", value: 85 },
      { attr: "DEF", value: 65 },
    ],
  },
  {
    playerName: {
      firstName: "Ollie",
      lastName: "Norris",
      number: "12",
    },
    photo: ollienorris,
    stats: [
      { attr: "OFF", value: 120 },
      { attr: "AST", value: 98 },
      { attr: "TCK", value: 86 },
      { attr: "TRY", value: 99 },
      { attr: "PAS", value: 85 },
      { attr: "DEF", value: 65 },
    ],
  },
];

export default function PlayersPage() {
  return (
    <section>
      <PlayerHeading
        playerName={{
          firstName: "Tyrone",
          lastName: "Thompson",
          number: "12",
        }}
        photo={tyronethompson}
      />
      <PlayerHeading
        playerName={{
          firstName: "Ollie",
          lastName: "Norris",
          number: "12",
        }}
        photo={ollienorris}
      />
    </section>
  );
}
